import React from 'react';
import 'antd/dist/antd.css';
import { Layout, Menu,Button } from 'antd';
import {WrappedSignin }from "../Signin/Signin"
import './Navbar.css'
import { WrappedLogin } from '../Login/Login';
const { Header } = Layout;
export default class Navbar extends React.Component {
  state = { loginVisible: false ,signinVisible:false};

  showSigninDrawer = () => {
    this.setState({
      signinVisible: true,
    });
  };
  showLoginDrawer = () => {
    this.setState({
      loginVisible: true,
    });
  };

  onLoginClose = () => {
    this.setState({
      loginVisible: false,
    });
  };
  onSiginClose = () => {
    this.setState({
      siginVisible: false,
    });
  };
  render()
{
  let {signinVisible,loginVisible}=this.state
  return (
    <Layout className="navbar">
    <Header className="main-header">
      <Menu
        mode="horizontal"
        style={{ lineHeight: '65px' }}
      > 
        <Menu.Item key="1">
        <Button type="primary" onClick={this.showSigminDrawer} shape="rounded" ghost>
          Signup
        </Button>
        </Menu.Item>
        <Menu.Item key="2">  
        <Button type="primary" shape="rounded" nClick={this.showLoginDrawer}>
         Login
        </Button></Menu.Item>
      </Menu>
    </Header>
    <WrappedSignin
      visible={signinVisible}
      onClose={this.onSiginClose}
    />
    <WrappedLogin
      visible={loginVisible}
      onClose={this.onLoginClose}
    />
  </Layout>
  )
}
}
